import { createSlice } from "@reduxjs/toolkit"

const initialState = {
    movies: [{movieImage: ""}]
}

const CinemaSlicer = createSlice({
    name: "CinemaSlicer",
    initialState,
    reducers: {
        nulling(state, action) {
            state.a = "2"
        }
    }
});

export default CinemaSlicer.reducer
